INSERT INTO `pages_list` (`id`, `page_name`, `page_url`, `page_id`, `page_meta_title`, `page_meta_desc`, `blocked_page`, `status`, `page_content`, `main_page`) VALUES
(1, '[\"Accueil\"]', 'index', 'accueil', '[\"→ Artisan fleuriste Les fleurs de Riton | Saint-Didier-sous-Aubenas\"]', '[\"Artisan fleuriste sur Saint-Didier-sous-Aubenas - Les Fleurs de Riton vous accompagne dans la décoration florale de votre évenement\"]', 1, 1, '[\"&lt;!-- Accueil --&gt;\\r\\n&lt;section class=&quot;home-screen position-relative-no-md ht-100vh-no-md&quot; id=&quot;home&quot;&gt;\\r\\n  &lt;div class=&quot;content-home position-absolute-no-md wd-100-no-md ht-100vh-no-md row-no-marge&quot;&gt;\\r\\n    &lt;div class=&quot;text ht-100vh-no-md col-6 col-xs-12 no-marge&quot;&gt;\\r\\n      &lt;div class=&quot;padding-all-on-md&quot;&gt;\\r\\n        &lt;h1&gt;&lt;span class=&quot;small&quot; data-aos=&quot;fade-up&quot;&gt;Artisan Fleuriste sur Saint-Didier-sous-Aubenas&lt;/span&gt; &lt;span class=&quot;title&quot; data-aos=&quot;fade-up&quot;&gt;Les fleurs de Riton&lt;/span&gt; &lt;span class=&quot;subtitle&quot; data-aos=&quot;fade-up&quot;&gt;&lt;em&gt;Tous les évenements de la vie&lt;/em&gt;&lt;/span&gt;&lt;/h1&gt;\\r\\n      &lt;/div&gt;\\r\\n    &lt;/div&gt;\\r\\n\\r\\n    &lt;figure class=&quot;image ht-100vh-no-md col-6 col-xs-12 no-marge&quot; data-aos=&quot;fade-left&quot;&gt;&lt;img alt=&quot;Logo - Les Fleurs de Riton&quot; src=&quot;../uploads/images/pages/logo.png&quot; /&gt;&lt;/figure&gt;\\r\\n  &lt;/div&gt;\\r\\n\\r\\n  &lt;div class=&quot;parallax-section position-absolute-no-md wd-100-no-md ht-100vh-no-md&quot;&gt;\\r\\n    &lt;figure class=&quot;parallax-element&quot;&gt;&lt;img alt=&quot;Bouquet de Mariage&quot; src=&quot;../uploads/images/pages/bg-home.png&quot; /&gt;&lt;/figure&gt;\\r\\n  &lt;/div&gt;\\r\\n\\r\\n  &lt;figure class=&quot;scroll-down position-absolute&quot;&gt;&lt;a class=&quot;nav-link&quot; data-link=&quot;#about&quot; href=&quot;#about&quot;&gt;&lt;img alt=&quot;En savoir plus&quot; src=&quot;../uploads/images/pages/arrow-down-solid.png&quot; /&gt;&lt;/a&gt;&lt;/figure&gt;\\r\\n&lt;/section&gt;\\r\\n&lt;!-- Présentation --&gt;\\r\\n\\r\\n&lt;section class=&quot;about&quot; id=&quot;about&quot;&gt;\\r\\n  &lt;div class=&quot;row-no-marge&quot;&gt;\\r\\n    &lt;div class=&quot;text col-6 col-sm-12 no-marge&quot;&gt;\\r\\n      &lt;div class=&quot;padding-all-on-md&quot;&gt;\\r\\n        &lt;h2 data-aos=&quot;fade-up&quot;&gt;Riton ? C&#039;est mon camion !&lt;br /&gt;\\r\\n          Magnifique Estafette de 1978&lt;/h2&gt;\\r\\n\\r\\n        &lt;p data-aos=&quot;fade-up&quot;&gt;Notre histoire à commencé en 2017 sur les petites routes Ardéchoises que nous avons empruntées pendant 3 ans pour vous fleurir et vous accompagner dans tous les évènements de la vie&amp;nbsp;: Anniversaires, fêtes, mariages, deuil, ainsi que pour la location de plantes et la décoration florale de vos entreprises&amp;nbsp;: restaurants, hôtels, agences...&lt;/p&gt;\\r\\n\\r\\n        &lt;p data-aos=&quot;fade-up&quot;&gt;Et c’est en juillet 2020, que nous avons décidé de nous installer en Zone de Millet à Saint-Didier-sous-Aubenas.&lt;/p&gt;\\r\\n\\r\\n        &lt;p data-aos=&quot;fade-up&quot;&gt;Nous vous accueillons dans notre boutique du Mardi au Samedi de 9h00 à 12h30 et de 14h00 à 19h00 et le Dimanche de 9H00 à 12H30.&lt;/p&gt;\\r\\n      &lt;/div&gt;\\r\\n    &lt;/div&gt;\\r\\n\\r\\n    &lt;figure class=&quot;image col-6 col-sm-12 no-marge cover-img-no-sm-4-3&quot; data-aos=&quot;reveal-left&quot;&gt;&lt;img alt=&quot;Les Fleurs de Riton - Le camion Riton&quot; src=&quot;/uploads/images/pages/photo-accueil.png&quot; /&gt;&lt;/figure&gt;\\r\\n  &lt;/div&gt;\\r\\n&lt;/section&gt;\\r\\n&lt;!-- Parallax --&gt;\\r\\n\\r\\n&lt;div class=&quot;parallax-section&quot;&gt;\\r\\n  &lt;figure class=&quot;parallax-element&quot;&gt;&lt;img alt=&quot;Bouquet de Mariage&quot; src=&quot;../uploads/images/pages/bg-parallax.jpg&quot; /&gt;&lt;/figure&gt;\\r\\n&lt;/div&gt;\\r\\n&lt;!-- Services --&gt;\\r\\n\\r\\n&lt;section class=&quot;services padding-all-on-md padding-horizontal-no-xs&quot; id=&quot;services&quot;&gt;\\r\\n  &lt;figure&gt;&lt;img alt=&quot;Picture&quot; id=&quot;image-viewer&quot; src=&quot;&quot; /&gt;&lt;/figure&gt;\\r\\n\\r\\n  &lt;div class=&quot;row&quot; data-aos=&quot;fade-up&quot;&gt;&lt;services&gt;&lt;/services&gt;&lt;/div&gt;\\r\\n&lt;/section&gt;\\r\\n&lt;!-- Contact --&gt;\\r\\n\\r\\n&lt;section class=&quot;contact&quot; id=&quot;contact&quot;&gt;\\r\\n  &lt;div class=&quot;row-no-marge&quot;&gt;\\r\\n    &lt;div class=&quot;infos col-6 col-sm-12 no-marge&quot;&gt;\\r\\n      &lt;div class=&quot;padding-all-on-md&quot;&gt;\\r\\n        &lt;h2 class=&quot;text-center margin-top-none&quot;&gt;Accès et contact&lt;/h2&gt;\\r\\n\\r\\n        &lt;p class=&quot;text-center&quot;&gt;149 chemin des Vignettes&lt;br /&gt;\\r\\n          Zone commerciale de, Chem. des Terres de Millet&lt;br /&gt;\\r\\n          07200 Saint-Didier-sous-Aubenas&lt;/p&gt;\\r\\n\\r\\n        &lt;p class=&quot;text-center&quot;&gt;&lt;a href=&quot;tel:+33684031554&quot;&gt;06 84 03 15 54&lt;/a&gt;&lt;/p&gt;\\r\\n\\r\\n        &lt;p class=&quot;text-center&quot;&gt;&lt;a href=&quot;javascript:void(location.href=&#039;mailto:&#039;+String.fromCharCode(99,111,110,116,97,99,116,64,108,101,115,102,108,101,117,114,115,100,101,114,105,116,111,110,46,99,111,109))&quot;&gt;contact@lesfleursderiton.com&lt;/a&gt;&lt;/p&gt;\\r\\n        &lt;contact&gt;&lt;/contact&gt;&lt;/div&gt;\\r\\n    &lt;/div&gt;\\r\\n\\r\\n    &lt;figure class=&quot;maps col-6 col-sm-12 padding-all position-relative no-marge cover-img-no-sm-4-3&quot;&gt;&lt;img alt=&quot;&quot; class=&quot;position-absolute wd-100 ht-100&quot; src=&quot;/uploads/images/pages/google-maps.jpg&quot; /&gt;\\r\\n      &lt;p class=&quot;gm-link position-absolute wd-100 ht-100 margin-none text-center&quot;&gt;&lt;a class=&quot;ht-100&quot; href=&quot;https://shorturl.at/dsxGM&quot; rel=&quot;noopener&quot; target=&quot;_blank&quot; title=&quot;Voir l&#039;itinéraire&quot;&gt;Calculer l&#039;itinéraire sur Google Maps&lt;/a&gt;&lt;/p&gt;\\r\\n    &lt;/figure&gt;\\r\\n  &lt;/div&gt;\\r\\n&lt;/section&gt;\"]', 1),
