INSERT INTO `services` (`id`, `label`, `pos`, `title`, `content`) VALUES
(1, 'Mariages', 0, 'Une décoration florale à l\'image de votre bonheur', '&lt;p&gt;Parce que votre mariage est un jour unique, il n&eacute;cessite toute notre attention. Nous mettons toute notre exp&eacute;rience et notre savoir-faire &agrave; votre disposition pour que ce jour reste &agrave; jamais grav&eacute; dans votre m&eacute;moire.&lt;/p&gt;\r\n\r\n&lt;p&gt;Aussi, n&rsquo;h&eacute;sitez pas &agrave; &lt;a href=&quot;#contact&quot;&gt;nous contacter&lt;/a&gt; afin de fixer un rendez-vous pour cibler au mieux vos attentes et r&eacute;colter toutes les informations n&eacute;cessaires &agrave; l&rsquo;&eacute;laboration de votre devis.&lt;/p&gt;'),
(2, 'Deuils', 1, 'Pour un dernier adieu', '&lt;p&gt;Pour une c&eacute;r&eacute;monie d&#039;enterrement et rendre hommage au d&eacute;funt, les fleurs sauront transmettre votre message et tous vos v&oelig;ux pour un dernier au revoir. Nous vous accompagnerons dans cette d&eacute;marche en vous apportant notre soutien et notre savoir-faire afin de choisir les fleurs les plus adapt&eacute;es, que ce soit en gerbes, bouquets, couronnes fun&eacute;raires..&lt;/p&gt;\r\n\r\n&lt;p&gt;N&rsquo;h&eacute;sitez pas &agrave; nous contacter par &lt;a href=&quot;tel:0684031554&quot; title=&quot;Contact par t&eacute;l&eacute;phone&quot;&gt;t&eacute;l&eacute;phone&lt;/a&gt; ou sur notre &lt;a href=&quot;#contact&quot; title=&quot;Formulaire de contact&quot;&gt;page de contact&lt;/a&gt; afin d&rsquo;&eacute;tudier au mieux votre demande.&lt;/p&gt;'),
(3, 'Fleurs de saison', 2, 'Fleur de saison : À chaque saison, son bouquet', '&lt;p&gt;Nos arrivages de fleurs &eacute;voluent au fil des saisons, ce qui nous permet de proposer des compositions toujours diff&eacute;rentes. N&rsquo;h&eacute;sitez pas &agrave; nous contacter afin de r&eacute;server la v&ocirc;tre.&lt;/p&gt;\r\n\r\n&lt;p&gt;Aussi, depuis peu, nous travaillons en collaboration avec une ferme florale &eacute;coresponsable dans le sud Ard&egrave;che et commen&ccedil;ons petit &agrave; petit &agrave; nous approvisionner de fa&ccedil;on raisonn&eacute;e et plus respectueuse de notre bel environnement. Fleuristes engag&eacute;es, nous avons &agrave; coeur de limiter notre impact &eacute;cologique en soutenant cette production locale.&lt;/p&gt;\r\n\r\n&lt;p&gt;Livraisons possibles 7j/7.&lt;/p&gt;'),
(4, 'Espace pro', 3, 'Espace pro, mais pas que !!! Professionnels, boostez votre visibilité ! Particuliers, rendez votre fête encore plus colorée !', '&lt;p&gt;Pour les professionnels nous proposons des contrats d&rsquo;abonnements floraux ou de location de plantes &agrave; la semaine, ou au mois, afin d&rsquo;&eacute;gayer et de sublimer vos vitrines, bureaux, salles d&rsquo;attentes, pour un meilleur accueil de votre client&egrave;le.&lt;/p&gt;\r\n\r\n&lt;p&gt;Pour les particuliers nous proposons la location ponctuelle de plantes pour tous types d&rsquo;&eacute;v&egrave;nements&amp;nbsp;: Salons, r&eacute;ceptions, cocktails, anniversaires, d&eacute;parts &agrave; la retraite&hellip;&lt;/p&gt;\r\n\r\n&lt;p&gt;N&rsquo;h&eacute;sitez pas &agrave; nous contacter par t&eacute;l&eacute;phone pour convenir d&rsquo;un rendez-vous.&lt;/p&gt;');
